import Navbar from './components/navbar';  // Import the Navbar component

function App() {
  return (
    <div>
      <Navbar/>
      <div>class="nav-bar-spacer"</div>
      <h1>Move faster with intuitive React UI tools</h1>
    </div>
  );
}

export default App;
